width: 50%;
margin: 5% 0 0 25%;
& > div {
    margin-top: 20px;
  }
`;

const AddUser = () => {
  const [user,setUser]=useState()
  return (
    < Container>

      <Typography varient="h4">AddUser</Typography>
      <FormControl>
        <InputLabel htmlFor='my-input'>Name</InputLabel>
        <Input />
